import React, { useState } from 'react';

const Item = (props) => {
    const [clicked, setClicked] = useState(false);

    return <li key={props.key} onClick={() => setClicked(!clicked)} style={clicked ? {textDecoration: 'line-through'} : null}>{props.value}</li>;
};

export default Item;
